import React from "react";

import { Container, Tile } from "./styles";

const IsometricTile: React.FC<IIsometricTile> = ({ ...rest }) => {
  return (
    <Container {...rest}>
      <Tile {...rest} />
    </Container>
  );
};

export default IsometricTile;
